import Vue from 'vue'
import Router from 'vue-router'
import Meta from 'vue-meta'

import Page03 from './views/page-03'
import Page02 from './views/page-02'
import Home from './views/home'
import NotFound from './views/not-found'
import './style.css'

Vue.use(Router)
Vue.use(Meta)
export default new Router({
  mode: 'history',
  routes: [
    {
      name: 'Page-03',
      path: '/page-03',
      component: Page03,
    },
    {
      name: 'Page-02',
      path: '/page-02',
      component: Page02,
    },
    {
      name: 'Home',
      path: '/',
      component: Home,
    },
    {
      name: '404 - Not Found',
      path: '**',
      component: NotFound,
      fallback: true,
    },
  ],
})
